import React from 'react';

export default () => {
  const onDragStart = (event, nodeType) => {
    event.dataTransfer.setData('application/reactflow', nodeType);
    event.dataTransfer.effectAllowed = 'move';
  };

  return (
<>
    <button onClick={InputNode}  onDragStart={(event) => onDragStart(event, 'input')} draggable className="btn-input">
    Input   Node
    </button>
    <button onClick={DefaultNode}  onDragStart={(event) => onDragStart(event, 'input')} draggable className="btn-default">
     Default Node
    </button>
    <button onClick={OutputNode}  onDragStart={(event) => onDragStart(event, 'input')} draggable className="btn-output">
     Output Node
    </button>
    </>
